// SPDX-License-Identifier: MIT
pragma solidity >=0.8.0;

import './Token.sol';
import 'openzeppelin-solidity/contracts/access/Ownable.sol';

contract TokenFactory is Ownable {
    Token[] public tokenAddresses;
    event Transfer(
        address indexed _token,
        address indexed _from,
        address indexed _to,
        uint256 _value
    );
    event Approval(
        address indexed _token,
        address indexed _owner,
        address indexed _spender,
        uint256 _value
    );
    modifier isTokenPresent() {
        require(tokenAddresses.length > 0, 'No tokens are present');
        _;
    }

    event AddedValuesByDelegateCall(bool success);

    event consoleLog(address contractOwner, address sender);

    function createToken(
        string memory name_,
        string memory symbol_,
        address minter_,
        address burner_
    ) external onlyOwner returns (Token tokenAddress) {
        Token td = new Token(name_, symbol_, minter_, burner_);
        tokenAddresses.push(td);
        emit consoleLog(address(this), address(td));
        return td;
    }

    function findAddress(address token) internal view returns (uint256 index) {
        for (uint256 i = 0; i < tokenAddresses.length; i++) {
            if (address(tokenAddresses[i]) == token) {
                return i;
            }
        }
        require(false, 'token not present');
    }

    function balanceOf(address _token, address _owner)
        external
        view
        isTokenPresent
        returns (uint256 balance)
    {
        uint256 index = findAddress(_token);
        return tokenAddresses[index].balanceOf(_owner);
    }

    function mintCoins(
        address _token,
        address _to,
        uint256 _value
    ) external isTokenPresent returns (bool success) {
        uint256 index = findAddress(_token);
        (bool success, bytes memory result) =
            _token.delegatecall(
                abi.encodeWithSignature(
                    'mintCoins(address,uint256)',
                    _to,
                    _value
                )
            );
        emit AddedValuesByDelegateCall(success);
        emit Transfer(_token, msg.sender, _to, _value);
        return true;
    }

    function mintOld(
        address _token,
        address _to,
        uint256 _value
    ) external isTokenPresent returns (bool success) {
        uint256 index = findAddress(_token);
        tokenAddresses[index].mintCoins(_to, _value);
        emit Transfer(_token, msg.sender, _to, _value);
        return true;
    }

    function transfer(
        address _token,
        address _to,
        uint256 _value
    ) external isTokenPresent returns (bool success) {
        uint256 index = findAddress(_token);
        (bool success, bytes memory result) =
            address(tokenAddresses[index]).delegatecall(
                abi.encodeWithSignature(
                    'transfer(address,uint256)',
                    _to,
                    _value
                )
            );
        require(!success, 'Cannot transfer token');
        emit Transfer(_token, msg.sender, _to, _value);
        return true;
    }

    function transferFrom(
        address _token,
        address _from,
        address _to,
        uint256 _value
    ) external isTokenPresent returns (bool success) {
        uint256 index = findAddress(_token);
        (bool success, bytes memory result) =
            address(tokenAddresses[index]).delegatecall(
                abi.encodeWithSignature(
                    'transferFrom(address,address,uint256)',
                    _from,
                    _to,
                    _value
                )
            );
        require(!success, 'Cannot transferFrom token');
        emit Transfer(_token, msg.sender, _to, _value);
        return true;
    }

    function approve(
        address _token,
        address _spender,
        uint256 _value
    ) external isTokenPresent returns (bool success) {
        uint256 index = findAddress(_token);
        tokenAddresses[index].approve(_spender, _value);
        emit Approval(_token, msg.sender, _spender, _value);
        return true;
    }

    function allowance(
        address _token,
        address _owner,
        address _spender
    ) external view isTokenPresent returns (uint256 remaining) {
        uint256 index = findAddress(_token);
        return tokenAddresses[index].allowance(_owner, _spender);
    }
}
